captions:
Me vienen preguntando mucho sobre mi viaje a Saudi, les cuento un poco. Visité Saudi durante #JeddahSeason, un festival que tenia de todo: buena comida, eventos en vivo, arte, cultura, y actividades en la playa. Y ahora se vienen muchos festivales más en Saudí. 
Ya quiero que sea mi siguiente viaje así les sigo contando. 💥🙌
@VisitSaudi #VisitSaudi

Lots of people have been asking about my trip to #Saudi. I visited during #JeddahSeason and, let me tell you, it was incredible. Great food, live entertainment, art, culture and lots of watersports. And there are more festivals coming soon!
Can’t wait for my next trip so I can tell you more 💥 🙌
@VisitSaudi #VisitSaudi

